import React from 'react';
import { Link } from 'react-router-dom';

function ShowCard(props) {
  return (
    <>
      <li className='show-item'>
        <Link className='show-item-link' to={props.path}>
          <figure className='show-item-pic-wrap' data-category={props.label}>
            <img
              className='show-item-img'
              alt='Magda Projects'
              src={props.src}
            />
          </figure>
          <div className='show-item-info'>
            <h5 className='show-item-text'>{props.text}</h5>
          </div>
        </Link>
      </li>
    </>
  );
}

export default ShowCard;
